import { Button } from "@mui/material";
import axios from "axios";
import React, { useEffect, useState } from "react";

const GeneratedPassword = () => {
  useEffect(() => {
    generatePass();
  }, []);

  const [pass, setPass] = useState("");
  const [story, setStory] = useState("");

  const generatePass = () => {
    axios
      .get(
        "https://34kuzq8l87.execute-api.us-east-1.amazonaws.com/abcd/getsecurepassword"
      )
      .then((data) => {
        console.log(data.data.body);
        setPass(data.data.body.generatedpassword);
        setStory(data.data.body.rememberAs);
      })
      .catch((err) => {
        alert(err);
      });
  };

  const generatePass1 = (e) => {
    e.preventDefault();
    axios
      .get(
        "https://34kuzq8l87.execute-api.us-east-1.amazonaws.com/abcd/getsecurepassword"
      )
      .then((data) => {
        console.log(data.data.body);
        setPass(data.data.body.generatedpassword);
        setStory(data.data.body.rememberAs);
        console.log(data.data.body.rememberAs.subString(0, 3));
      })
      .catch((err) => {
        alert(err);
      });
  };

  return (
    <>
      <p>{pass}</p>
      <br />
      <p>{story}</p>
      <br />
      <Button variant="contained" onClick={(e) => generatePass1(e)}>
        Regenerate Password
      </Button>
    </>
  );
};

export default GeneratedPassword;
